test = """



"""
keypad = [['X','X',1,'X','X'],['X',2,3,4,'X'],[5,6,7,8,9],
          ['X','A','B','C','X'],['X','X','D','X','X']]
def move(initial, instructions):
    for i in instructions:
        if i == "R":
            if keypad[initial[0]][min(4, initial[1]+1)] != "X":
                initial[1] = min(4, initial[1]+1)
        if i == "L":
            if keypad[initial[0]][max(0, initial[1]-1)] != "X":
                initial[1] = max(0, initial[1]-1)
        if i == "U":
            if keypad[max(initial[0]-1, 0)][initial[1]] != "X":
                initial[0] = max(initial[0]-1, 0)
        if i == "D":
            if keypad[min(initial[0] + 1, 4)][initial[1]] != "X":
                initial[0] = min(initial[0] + 1, 4)
    return initial
space = [2,0]
for row in [list(x) for x in test.split("\n")]:
    space = move(space, row)
    print(keypad[space[0]][space[1]])
    